#include <stdio.h>
#include <stdlib.h>

int findMaxLength(int* nums, int numsSize){
    int i, sum = 0, longest = 0;
    int positive[numsSize+1];
    int negative[numsSize+1];
    
    memset(positive, -1, sizeof(int)*(numsSize+1));
    memset(negative, -1, sizeof(int)*(numsSize+1));

    for (i = 0; i <=numsSize; i++) {
        if (nums[i] == 1)
            sum++;
        else
            sum--;
        
        if(sum == 0) {
            if (longest < (i+1))
                longest = i+1;
        } else if (sum < 0) {
            if (negative[abs(sum)] != -1) {
                if (longest < (i-negative[abs(sum)]))
                    longest = i-negative[abs(sum)];
            } else {
                negative[abs(sum)] = i;
            } 
        } else {
            if (positive[sum] != -1) {
                if (longest < (i-positive[sum]))
                    longest = i-positive[sum];
            } else
                positive[sum] = i;
        }
    }
    
    return longest;
}

